import { useState } from 'react'

export default function Home(){
   const [authen ,setAuthen] = useState(false);
   

    return(
       <>
       

<div> 
 
       {(function(){

       if(authen === true){

             return (
                 <div> 
             <h2> Welcom you are Admin   </h2>
 
           
          <li><Link to='/components/Admin/loginAdmin'>Admin</Link></li>
          <li><Link to='/components/Admin/AddNewClinic'>Add New Appointment</Link></li>
         
          </div>
          )

          }
          else if (authen === false){

            return <h2> You must Login </h2>
          }
       })()}
</div>


       <div  className='homepage'> 
    
    <h1>Primary  dental <span >clinic</span> <br/>appointment 
    <br/> <span>(PDCA)</span> </h1> 
   
    </div><br/>
       </>
    )
}
